import * as serviceWorker from './serviceWorker';
import state, {subscribe} from "./redux/state/state";
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


import {add_post, update_new_text} from "./redux/state/state";

let rerender_entire_tree = (state) => {
    ReactDOM.render(
        <React.StrictMode> <App state={state} add_post={add_post} update_new_text={update_new_text}/>
        </React.StrictMode>,
        document.getElementById('root')
    );
}

rerender_entire_tree(state);
subscribe()
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
